import{_ as e,c as t,o,Q as r}from"./chunks/framework.31184730.js";const h=JSON.parse('{"title":"Переопределить","description":"","frontmatter":{"title":"Переопределить","layout":"doc"},"headers":[],"relativePath":"ru/guide/overview.md","filePath":"ru/guide/overview.md","lastUpdated":null}'),a={name:"ru/guide/overview.md"},l=r('<h1 id="переопределить" tabindex="-1">Переопределить <a class="header-anchor" href="#переопределить" aria-label="Permalink to &quot;Переопределить&quot;">​</a></h1><p>TelebotE — это быстрообновляемая и высокопроизводительная версия <a href="https://github.com/tucnak/telebot" target="_blank" rel="noreferrer">Telebot</a>. В этом документе Telebot означает TelebotE, если не указано иное.</p><p>Telebot не может быть напрямую перенесен на TelebotE, поскольку некоторые API-интерфейсы TelebotE отличаются от Telebot. Это беспомощный шаг, и со временем в нем появятся более разрушительные обновления.</p><hr><p>Telebot — это платформа роботов <a href="https://core.telegram.org/bots/api" target="_blank" rel="noreferrer">Telegram BotAPI</a>. Этот пакет предоставляет лучшие в своем классе API-интерфейсы для маршрутизации команд, встроенных запросов и клавиатуры в качестве обратных вызовов. На самом деле я пошел еще дальше и не стал создавать оболочку API 1:1, а вместо этого сосредоточился на красоте API и производительности.</p><p>Некоторые преимущества Телебота:</p><ul><li>Действительно простой интерфейс</li><li>маршрутизация команд</li><li>промежуточное программное обеспечение</li><li>прозрачный файловый интерфейс</li><li>Легкие обратные вызовы ботов</li></ul><p>Все методы Telebot API очень легко запомнить и привыкнуть. Кроме того, рассмотрите готовые телеробототехнические решения с высокой полезной нагрузкой. Я буду тестировать и сравнивать наиболее популярные операции и при необходимости оптимизировать их, не жертвуя при этом качеством API.</p>',8),i=[l];function _(n,s,c,p,d,u){return o(),t("div",null,i)}const T=e(a,[["render",_]]);export{h as __pageData,T as default};
